import CardList from './CardList';
import {robots} from './robots';
import SearchBox from './SearchBox';

const state = {
	robots:'',
	searchfield:''
}

class App extends React.Component{
	render(){
		return (
			<div className='tc'>
				<h1> RoboFriends </h1>
				<SearchBox />
				<CardList robots={robots} />
			</div>
		);
	}
}

export default App;
